  input: TEXT,F3XA,,"We are in receipt of your letter dated July 11, 2007 regarding
    the April Monthly Report. The contributions that you questioned that appear to
    be from corporations are not from corporations. They are from Partnerships and
    Sole Proprietorships that are not prohibited contributions. These contributions
    have been attributed to the Partnerships and the Partners or to the Sole Proprietorship
    and the Sole Proprietor. The receipts reported on Schedule A Line 15 from Wyden
    for Senate Future PAC and Multnomah County Democratic Central Comm. are offsets
    for the payment of rent. The Democratic Party of Oregon shares office space with
    several organizations. We write one check to pay rent. The amount of rent paid
    by each organization is assessed at the usual and normal charge, determined by
    the amount of space occupied by the organization. Schedule B does report the value
    of in-kind contributions as disbursements. These transactions can be identified
    in the purpose field. They are reported as Auction Item followed by a description
    of the item donated. Occupation and Employer information missing on the original
    report was requested through Best Effort procedures in compliance with the FEC.
    Original solicitations include the request for contributor information as required
    by Federal law. If we do not receive the information we follow up with a telephone
    or written request. This report includes updates received subsequent to the original
    filing through our Best Effort procedure. We have not received the requested information
    from two contributors. Their records indicate Best Effort in the occupation and
    employer fields. If we are able to obtain this information we will report it to
    the FEC. Payments for salaries and wages reported on Schedule H4 are for employees
    who spent less than 25% of their time on FEA or activities in connection with
    a Federal election. Employees who spend more than 25% of their time on FEA or
    activities in connection with a Federal election are paid with 100% Federal funds
    as are their fringe benefits and reported on Line 30b.  The reporting of corporate
    in kind donations in connection with fundraising activities has been corrected
    and properly disclosed. The individual who received payment  for website development
    is not an employee of the committee, but doing work as an independent contractor.  In
    addition we have been notified by the Democratic National Committee that the memo
    schedules for the OR Party Victory Fund joint fundraising program provided for
